 // update the table using "onclasschange"\n            // and trigger child component\'s function "triggerSearchUpdate"\n            for (const m of mutations) {\n                const newValue = m.target.getAttribute(m.attributeName);\n                nextTick(() => {\n                    onclasschange(newValue, m.oldValue);\n                });\n            } // for\n        });\n\n        onBeforeUnmount(observer.disconnect());\n\n        onMounted(() => {\n            observer.observe(detectclasschange.value, {\n                attributes: true,\n                attributeOldValue: true,\n                attributeFilter: [\'class\'],\n            });\n\n            watch(\n                () => myChild.value.flip,\n                (newVal) => {\n                    $(\'.flip-card\').toggleClass(\'transition\');\n                }\n            );\n\n            watch(\n                () => myChild2.value.flip,\n                (newVal) => {\n                    $(\'.flip-card\').toggleClass(\'transition\');\n                }\n            );\n        });\n\n        const triggerModal = async () => {\n            $("body").loadingModal({\n                text: "Loading...",\n                animation: "circle",\n            });\n\n            return new Promise((resolve, reject) => {\n                resolve();\n            });\n        } // triggerModal\n\n        const onclasschange = async (classattrvalue) => {\n            await triggerModal();\n            const classlist = classattrvalue.split(\' \');\n            if (classlist.includes(\'transition\')) {\n                await myChild2.value.triggerSearchUpdate();\n            } // if\n            $("body").loadingModal("hide");\n            $("body").loadingModal("destroy");\n        } // onclasschange\n\n        return {\n            myChild,\n            myChild2,\n            detectclasschange,\n        };\n    }, // setup\n});\n<\/script>\n<style scoped>\n.flip-card {\n    background-color: transparen